PlayVoices::TypeVoice SynthesizerAudioProcessorEditor::convertStringToEnum(String value)
{
    if(value == "Sine")
        return PlayVoices::TypeVoice::SINE;
    else if(value == "Triangle")
        return PlayVoices::TypeVoice::TRIANGLE;
    else if(value == "Saw")
        return PlayVoices::TypeVoice::SAW;
    else
        return PlayVoices::TypeVoice::SQUARE;
}


void SynthesizerAudioProcessorEditor::updateMixOscillators()
{


    if(mixLevel->getValue()<0)
    {
        for (int i=0; i<processor.getNumberOfVoices(); i++)
        {
            processor.getVoicesOsc1().at(i)->setNumSamplesBuffer(processor.getNumSamplesBuffer());
            processor.getVoicesOsc2().at(i)->setNumSamplesBuffer(processor.getNumSamplesBuffer());
            processor.getVoicesOsc1().at(i)->setMix(mixLevel->getValue());
            processor.getVoicesOsc2().at(i)->setMix(0);
        }
    }
    else if(mixLevel->getValue()>0)
    {
        for (int i=0; i<processor.getNumberOfVoices(); i++)
        {
            processor.getVoicesOsc1().at(i)->setNumSamplesBuffer(processor.getNumSamplesBuffer());
            processor.getVoicesOsc2().at(i)->setNumSamplesBuffer(processor.getNumSamplesBuffer());
            processor.getVoicesOsc1().at(i)->setMix(0);
            processor.getVoicesOsc2().at(i)->setMix(mixLevel->getValue());
        }
    }
    else if(mixLevel->getValue() == 0)
    {
        for (int i=0; i<processor.getNumberOfVoices(); i++)
        {
            processor.getVoicesOsc1().at(i)->setMix(0);
            processor.getVoicesOsc2().at(i)->setMix(0);
        }
    }
}

void SynthesizerAudioProcessorEditor::updateFilters()
{
    for (int i=0; i<processor.getNumberOfVoices(); i++)
    {
        processor.getVoicesOsc1().at(i)->createFilters();
        processor.getVoicesOsc2().at(i)->createFilters();
    }


    for (int i=0; i<processor.getNumberOfVoices(); i++)
    {
        processor.getVoicesOsc1().at(i)->setFrequency(freqCut->getValue());
        processor.getVoicesOsc2().at(i)->setFrequency(freqCut->getValue());
    }

    if(selectFilterType->getValue() == 1)
    {
        for (int i=0; i<processor.getNumberOfVoices(); i++)
        {
            processor.getVoicesOsc1().at(i)->setFilterType(Oscillator::FilterType::LPF);
            processor.getVoicesOsc2().at(i)->setFilterType(Oscillator::FilterType::LPF);
        }
    }
    else if(selectFilterType->getValue() == 2)
    {
        for (int i=0; i<processor.getNumberOfVoices(); i++)
        {
            processor.getVoicesOsc1().at(i)->setFilterType(Oscillator::FilterType::BPF);
            processor.getVoicesOsc2().at(i)->setFilterType(Oscillator::FilterType::BPF);

            processor.getVoicesOsc1().at(i)->setQFactor(qFactor->getValue());
            processor.getVoicesOsc2().at(i)->setQFactor(qFactor->getValue());
        }
    }
    else if(selectFilterType->getValue() == 3)
    {
        for (int i=0; i<processor.getNumberOfVoices(); i++)
        {
            processor.getVoicesOsc1().at(i)->setFilterType(Oscillator::FilterType::HPF);
            processor.getVoicesOsc2().at(i)->setFilterType(Oscillator::FilterType::HPF);
        }
    }

}

